        protected void CalcoloPrev_Click(object sender, EventArgs e)
        {
            int AutoScelta = Convert.ToInt32(ElencoAuto.SelectedValue);

            foreach (Auto a in Auto.GetAuto())
            {
                if (a.Id == AutoScelta)
                {
                    string opzioni = "";
                    decimal CostoOpzioni = 0;
                    decimal Totale = 0;
                    string garanzia = Garanzia.SelectedItem.Value;
                    decimal prezzoGaranzia = Convert.ToDecimal(garanzia);

                    foreach (ListItem agg in Opzioni.Items)
                    {
                        if (agg.Selected)
                        {
                            opzioni += $" {agg.Text} ";
                            CostoOpzioni += Convert.ToInt32(agg.Value);
                            Label2.Text += $"{CostoOpzioni} </b></br>";
                        }
                    }

                    foreach (ListItem gar in Garanzia.Items)
                    {
                        if (gar.Selected)
                        {
                            garanzia+= $"{gar.Value}";
                            prezzoGaranzia+= Convert.ToInt32(gar.Value);
                            Label3.Text += $"{prezzoGaranzia}</b></br>";
                        }
                    }

                    Auto auto = new Auto()
                    {
                        NomeAuto = $"{a.NomeAuto} {opzioni}",
                        PrezzoAuto = a.PrezzoAuto,
                    };
                    Auto.AutoSelezionata.Add(auto);

                    foreach (Auto am in Auto.AutoSelezionata)
                    {
                        Label1.Text += $"{am.PrezzoAuto} </b></br>";
                    }
                    Totale = a.PrezzoAuto + CostoOpzioni + prezzoGaranzia;
                     Label4.Text += $"{Totale} </b></br>";
                    
                }

                foreach (ListItem item in Opzioni.Items)
                {
                    item.Selected = false;
                    Label1.Text += "";
                    Label2.Text += "";
                    Label3.Text += "";
                    Label4.Text += "";
                }
            }
        }
        


